'use strict';
class OpenPositionsUpdater {
    static makeUpdate(oldOpenPositionBuilder, updOpenPosition) {
        if (updOpenPosition.isAmountChanged()) {
            oldOpenPositionBuilder.setAmount(updOpenPosition.getOpenPosition().getAmount());
        }
        if (updOpenPosition.isOpenRateChanged()) {
            oldOpenPositionBuilder.setOpenRate(updOpenPosition.getOpenPosition().getOpenRate());
        }
        if (updOpenPosition.isOpenTimeChanged()) {
            oldOpenPositionBuilder.setOpenTime(updOpenPosition.getOpenPosition().getOpenTime());
        }
        if (updOpenPosition.isOpenQuoteIdChanged()) {
            oldOpenPositionBuilder.setOpenQuoteId(updOpenPosition.getOpenPosition().getOpenQuoteId());
        }
        if (updOpenPosition.isCommissionChanged()) {
            oldOpenPositionBuilder.setCommission(updOpenPosition.getOpenPosition().getCommission());
        }
        if (updOpenPosition.isRolloverInterestChanged()) {
            oldOpenPositionBuilder.setRolloverInterest(updOpenPosition.getOpenPosition().getRolloverInterest());
        }
        if (updOpenPosition.isTradeIdOriginChanged()) {
            oldOpenPositionBuilder.setTradeIdOrigin(updOpenPosition.getOpenPosition().getTradeIdOrigin());
        }
        if (updOpenPosition.isValueDateChanged()) {
            oldOpenPositionBuilder.setValueDate(updOpenPosition.getOpenPosition().getValueDate());
        }
        if (updOpenPosition.isPartiesChanged()) {
            oldOpenPositionBuilder.setParties(updOpenPosition.getOpenPosition().getParties());
        }
        if (updOpenPosition.isAccountIdChanged()) {
            oldOpenPositionBuilder.setAccountId(updOpenPosition.getOpenPosition().getAccountId());
        }
        if (updOpenPosition.isAccountNameChanged()) {
            oldOpenPositionBuilder.setAccountName(updOpenPosition.getOpenPosition().getAccountName());
        }
        OpenPositionsUpdater.makeUpdateRest(oldOpenPositionBuilder, updOpenPosition);
    }
    static makeUpdateRest(oldOpenPositionBuilder, updOpenPosition) {
        if (updOpenPosition.isAccountKindChanged()) {
            oldOpenPositionBuilder.setAccountKind(updOpenPosition.getOpenPosition().getAccountKind());
        }
        if (updOpenPosition.isOfferIdChanged()) {
            oldOpenPositionBuilder.setOfferId(updOpenPosition.getOpenPosition().getOfferId());
        }
        if (updOpenPosition.isBuySellChanged()) {
            oldOpenPositionBuilder.setBuySell(updOpenPosition.getOpenPosition().getBuySell());
        }
        if (updOpenPosition.isOpenOrderIdChanged()) {
            oldOpenPositionBuilder.setOpenOrderId(updOpenPosition.getOpenPosition().getOpenOrderId());
        }
        if (updOpenPosition.isOpenOrderReqIdChanged()) {
            oldOpenPositionBuilder.setOpenOrderReqId(updOpenPosition.getOpenPosition().getOpenOrderReqId());
        }
        if (updOpenPosition.isOpenOrderRequestTXTChanged()) {
            oldOpenPositionBuilder.setOpenOrderRequestTXT(updOpenPosition.getOpenPosition().getOpenOrderRequestTXT());
        }
        if (updOpenPosition.isDividendsChanged()) {
            oldOpenPositionBuilder.setDividends(updOpenPosition.getOpenPosition().getDividends());
        }
    }
}
module.exports = OpenPositionsUpdater
